import React, { useState, useEffect } from "react";

// set initial values 
const initialvalues = {
  id: 0,
  username: '',
  password: ''
}

const UserLogin = () => {

  const [values, setValues] = useState(initialvalues)

  return (
    <>
      <form>
        <Grid container>
          <Grid item xs={6}>
            <TextField 
              variant="outlined"
              label="username"
              value={values.username}
            />
          </Grid>  
        </Grid>
      </form>
    </>
  );
};

export default UserLogin;
